import nav_style from "../styles/nav_style";

function Nav(){
    return (
        <nav_style.Nav_div>
        <nav_style.Nav_flexContainer>
        <img
		style={{ width: "154px", height: "20px" }}
		src="https://www.themoviedb.org/assets/2/v4/logos/v2/blue_short-8e7b30f73a4020692ccca9c88bafe5dcb6f8a62a4c6bc55cd9ba82bb2cd95f6c.svg"
		alt="로고"/>
        <ul>
            <nav_style.Menu_li><span>영화</span></nav_style.Menu_li>
            <li><span>TV 프로그램</span></li>
            <li><span>인물</span></li>
        </ul>
        </nav_style.Nav_flexContainer>
        </nav_style.Nav_div>
    );
}

export default {Nav};
